import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Link } from "react-router-dom";

const App = () => {
  return (
  <div>
    <header className='headerLinks'>
    <Link>Home</Link>
    <Link>Activies</Link>
    <Link>MyRoutines</Link>
    <Link>Routines</Link>
    <Link>Login</Link>
    <Link>Register</Link>
    HELLO
    </header>
  </div>
  )
}

ReactDOM.render(
  <BrowserRouter>
  <App />
  </BrowserRouter>

,
  document.getElementById('app'),
